import "./List.css";
export const List = ({ todos, title }) => {
  return (
    <>
      <h2>{title}</h2>
      <ul>
        {todos.map(({ text, id }) => (
          <li key={id}>
            <p>{text}</p>
            <button>Удалить</button>
          </li>
        ))}
      </ul>
    </>
  );
};
